import Grid from "@material-ui/core/Grid";
export default function Index() {
  return (
    <Grid container spacing={2}style={{padding:13}}>
      <Grid item xs={7}></Grid>
      <Grid item xs={5}>
        <img style={{ width: "100%" }} src="/img/banner.png" />
      </Grid>
    </Grid>
  );
}
